import React from 'react';
import "./jobCard.css"

const JobCard = (props) => {
    return (
        
  <div className="card">
    <div className="box">
      <div className="content">
        <h2>Python</h2>
        <h3>Python Programming</h3><br/><br/>
        <p>Master the basics and advanced concepts of Python.</p>
        <a >Sign-Up</a>
      </div>
    </div>
  </div>
  
    );
}

export default JobCard;
